import React from 'react';
import './Orderbook.css';

interface Order {
  price: number;
  quantity: number;
}

interface OrderbookData {
  bids: Order[];
  asks: Order[];
}

interface OrderbookProps {
  asset: string;
  orderbook: OrderbookData;
}

const Orderbook: React.FC<OrderbookProps> = ({ asset, orderbook }) => {
  return (
    <div className="Orderbook">
      <div className="orderbook-section">
        <h3>Asks</h3>
        <div className="order-header">
          <span>Price</span>
          <span>Quantity</span>
          <span>Amount (USD)</span>
        </div>
        <div className="order-list asks-list">
          {orderbook.asks.map((ask, index) => (
            <div className="order-item" key={index}>
              <span>{ask.price}</span>
              <span>{ask.quantity}</span>
              <span>{(ask.price * ask.quantity).toFixed(2)}</span>
            </div>
          ))}
        </div>
      </div>
      <div className="orderbook-section">
        <h3>Bids</h3>
        <div className="order-header">
          <span>Price</span>
          <span>Quantity</span>
          <span>Amount (USD)</span>
        </div>
        <div className="order-list bids-list">
          {orderbook.bids.map((bid, index) => (
            <div className="order-item" key={index}>
              <span>{bid.price}</span>
              <span>{bid.quantity}</span>
              <span>{(bid.price * bid.quantity).toFixed(2)}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Orderbook;
